+  max-width: 1280px;
+  margin: 0 auto;
+  display: flex;
+  justify-content: flex-end;
+  align-items: center;
+  padding: 24px 23px 24px 0;
+  width: 100%;
+  z-index: 9999;
+
+  .logo {
+    margin-right: auto;
+    z-index: 9999;
+
+    p {
+      font-size: 32px;
+      font-family: "Classical";
+      font-weight: 800;
+    }
+
