.outerWrapper {
  position: absolute;
  width: 100vw;
  padding: 0 12px;
  z-index: 999;
}

.wrapperOpen {
  position: fixed;
  z-index: 9999;
}

.wrapper {
  max-width: 1280px;
  margin: 0 auto;
  display: flex;
  justify-content: flex-end;
  align-items: center;
  padding: 24px 23px 24px 0;
  width: 100%;
  z-index: 9999;

  .logo {
    margin-right: auto;
    z-index: 9999;

    p {
      font-size: 32px;
      font-family: "Classical";
      font-weight: 800;
    }

    span {
      font-size: 24px;
      font-weight: 400;
    }
  }

  .links {
    display: flex;
    list-style: none;
    gap: 32px;

    li {
      font-size: 14px;
      font-weight: 700;
      cursor: pointer;
    }
  }

  .socials {
    display: flex;
    gap: 24px;
    margin-left: 54px;
    margin-top: 2px;
  }
}

.socialsLabel {
  font-weight: 500;
  margin-top: 32px;
  margin-left: 16px;
  margin-bottom: 16px;
  font-size: 15px;
}

.socialsMenu {
  display: flex;
  gap: 32px;
  bottom: 32px;
  margin-left: 16px;
  right: 32px;
  z-index: 9999;
}

.socialsMobile {
  display: none;
  gap: 24px;
  margin-top: 2px;
  margin-right: auto;
  z-index: 9999;
}

.hamburger {
  display: none;
  z-index: 9999;
}

.mobileMenu {
  width: 100%;
  height: 100lvh;
  position: fixed;
  left: -100%;
  z-index: 9998;
  top: 0;
  background-color: #000;
  transition: left 0.3s;

  * {
    z-index: 9999;
  }

  ul {
    display: flex;
    flex-direction: column;
    padding: 15px;
    margin-top: 15%;

    li {
      font-size: 18px;
      border-bottom: 1px solid #222;
      padding: 12px 0;
      font-weight: 500;
    }
  }
}

.open {
  left: 0;
}

@media (max-width: 769px) {
  .wrapper {
    .links {
      display: none;
    }

    .socials {
      display: none;
    }

    .logo {
      margin-right: 0;
    }
  }

  .hamburger {
    display: block;
  }

  .socialsMobile {
    display: flex;
    margin-left: 32px;
    margin-top: 8px;
  }

  .hamburger {
    transform: translateX(16px);
  }
}

@media (max-width: 639px) {
  .outerWrapper {
    position: fixed;
    background: #000;
  }
  .wrapper {
    padding: 3px 0;
    //padding-right: 24px;
  }

  .hamburger {
    transform: translateX(16px);
  }
}

@media (max-width: 539px) {
  .wrapper {
    .logo {
      margin-right: auto;

      p {
        font-size: 24px;

        span {
          font-size: 18px;
        }
      }
    }
  }
  .socialsMobile {
    display: none;
  }

  .hamburger {
    transform: translateX(8px);
  }
}
